import React from "react";
import { Grid, Card } from "@material-ui/core";

import { useStyles } from "./style";

function CardVagas() {
  const classes = useStyles();

  return (
    <Grid item xs={12} md={3} component={Card} className={classes.card}>
      Minhas Vagas
    </Grid>
  );
}

export default CardVagas;
